measurements.description:
Sixty-eight delicate flowers on 17 up to 23-cm inflorescences;
plant immaculate, 95 cm wide by 63 cm tall, grown in bark in a 30-cm plastic bulb pan; 

 sepals narrow, lanceolate, rolled and recurved distally, white blushed lavender;
 petals full, porrect, recurved distally, undulate margins, white, heavily blushed lavender, midrib white;

 lip tubular, flaring, undulate distally, white overlaid yellow, veined magenta basally, magenta distal quarter, picotee; 

 column white, anther cap white;
 substance medium; texture diamond dust; also received award 20245284.
